import React from 'react';
import classes from './Adposts.css';
import Posts from '../Poststhingys/Posts';

export default function Adposts() {
  return (
    <div className={classes.Supreme}>
      <p className={classes.para}>Fresh Recomendations</p>
      <div className={classes.Adposts}>
        <Posts />
        <Posts image="https://s3.amazonaws.com/www-inside-design/uploads/2020/10/aspect-ratios-blogpost-1x1-1.png" />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
        <Posts />
      </div>
    </div>
  )
};
